const explanations = [
  {
    title: "Sell Your NFT, English Auction Style",
    description:
      "Create a English Auction for your NFT. The auction will start at the price you set and will increase with the offers from interested buyers. The auction will end when the time you set has passed.",
    imageUrl: "/assets/nft5.png",
    time: 1000,
  },
  {
    title: "Bid on NFTs",
    description:
      "Participate in NFT auctions by placing bids. If you're the highest bidder when the auction ends, you win the NFT! The price you pay is the highest bid you placed. (If you're the only bidder, you pay the starting price.)",
    imageUrl: "/assets/art.jpg",
    time: 1000,
  },
];

